import styled from "styled-components"

const DirectoryMenuItem = styled.div`
    display:flex;
    flex-direction:column;
        .background{
            width:1140px;
            height:450px;
            background-repeat:no-repeat;
            margin:0 auto;

        }
                    .content{
                align-self:flex-end;
            }
`
export default DirectoryMenuItem
